import React from "react";
import "./SectionTen.css";
import ArrowForwardIcon from "@mui/icons-material/ArrowForward";
// import secImage from "./SectionTenImg.avif";

const data = [
  {
    id: 1,
    img: "./SectionTenImg1.avif",
  },
  {
    id: 2,
    img: "./SectionTenImg2.avif",
  },
  {
    id: 3,
    img: "./SectionTenImg3.avif",
  },
];

function SectionTen() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
    initialSlide: 0,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 3,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],
  };
  return (
    <div>
      <div className="SectionTen">
        <div className="sec1">
          <div className="col2">
            <h4>The Athenaeum</h4>
            <h1>The warm-up </h1>
            <p>
              In The Athenaeum, our digital reading room: a guide to ensuring a
              healthy complexion through the warmer months.
            </p>
            <a href="" className="btn">
              <p>Read more</p>
              <ArrowForwardIcon />
            </a>
          </div>
        </div>
        <div className="sec2">
          <Slider {...settings}>
            {data.map((x) => {
              return (
                <div className="col3">
                  <div>
                    <img src={x.img} alt="" />
                  </div>
                </div>
              );
            })}
          </Slider>
        </div>
      </div>
    </div>
  );
}

export default SectionTen;
